SHS3605 Capacità massima di sollevamento 14T Gru dritta su camion
Features
1. L'altezza di u boom hè aumentatu, chì riduce assai a deflection di u boom quandu u raghju di travagliu hè grande, è migliurà a capacità telescopica cù a carica;
2. U canna di u bracciu adopra 4 cuciture di saldatura esagonale, è a struttura di superposizione superiore è inferiore hà una forza strutturale più altu è un fattore di sicurezza più altu;
3. L'outrigger trasversale à longu span migliurà a stabilità di u veiculu è a capacità di elevazione di i bracci medii è longu;
4. U valve principale adopta valve multi-via prupurziunali manuali à rializà azzione cumposti è migliurà efficienza di u travagliu;
5. Pannellu di cuntrollu integratu (iniziu è arrestu di u mutore, etc.), l'operazione hè più simplice è affidabile;
6. U winch adopra a struttura di valvula d'alta vitezza, doppia equilibriu, è u funziunamentu di bassa vitezza hè più stabile;
7. A gamma di travagliu è a capacità di elevazione sò megliu cà i prudutti simili;
8. Tuttu u sistema hè furnutu cù radiatore standard;
I principali paràmetri tecnichi
Disegnu di dimensione di u contornu
Indicatori di rendiment
Diagramma di flussu di produzzione di camion gru montatu in camion
Nota: Saldatura è pittura sò prucessi speciali.

